using namespace std;

class Solution {
    inline int getbits(const string& str) {
        int bits = 0;
        for (char ch: str) bits |= 1 << (ch - 'a');
        return bits;
    }
    inline bool check(const string& str1, const string& str2) {
        int bits1 = getbits(str1);
        int bits2 = getbits(str2);
        return (bits1 | bits2) == (bits1 ^ bits2);
    }
public:
    int maxProduct(vector<string>& words) {
        int len = words.size();
        // unordered_map<int, int> products;
        // std::function<bool(int, int)> comp = [&] (int val1, int val2) {
        //     return products[val1] > products[val2];
        // };
        vector<long> poses;
        for (int i = 0; i < len; ++i) {
            long size1 = words[i].size();
            for (int j = i + 1; j < len; ++j) {
                long size2 = words[j].size();
                long val = ((size1 * size2) << 32) + (i << 16) + j;
                poses.push_back(val);
            }
        }
        sort(poses.begin(), poses.end(), [&] (long val1, long val2) {
            return val1 > val2;
        });
        for (long pos: poses) {
            auto& str1 = words[(pos >> 16) & 0xffff];
            auto& str2 = words[pos & 0xffff];
            if (check(str1, str2)) 
                return (int)(pos >> 32);
        }
        return 0;
    }
};

